import React from 'react'
class Dashboardheading extends React.Component{
    constructor(props){
        super()

    }
render(){
    return(
        <div className="main">
            <div className="heading">
                <div className="headingin">
                    <div className="in1">
                        <h1>Dashboard</h1>
                        <p> Organization name: Demo Account</p>
                        <p> Your previous login: 26/05/2020 at 16:04</p>          
                    </div>
                    <div className="in2">
                        
                        <p> <b><small>Download as PDF</small></b></p>
                        
                    </div>
                </div>
            </div>
        
        <style jsx>{`
        .main{
            width:100%;
        }
        .heading{
            display:flex;
            background:black;
            align-items:center;
            justify-content:center;
            margin-top:200px;
            width:100%;
        }
        .headingin{
            display:flex;
            width:70%;
            background:blue;
            height:170px;
        }
        .in1{
            display:flex;
            flex-direction:column;
            align-items: flex-start;
            width:50%;
            height:100%;
            padding-top:100px;
        }
        .in2{
            display:flex;
            width:50%;
            align-items:center;
            justify-content:flex-end;
            height:100%;
            background:pink;

        }

        
        
        
        `}

        </style>
        
        
        
        
        </div>
    )


    }



}
export default Dashboardheading;
